                <Link to="/listing" className="bg-blue-500 text-white px-2 py-1 rounded">All Products</Link>
                <Link to="/listing?category=pashmina-shawls" className="bg-blue-500 text-white px-2 py-1 rounded">Query Param</Link>
                <Link to="/category/pashmina-shawls" className="bg-blue-500 text-white px-2 py-1 rounded">URL Param</Link>
                <Link to="/product/1" className="bg-blue-500 text-white px-2 py-1 rounded">Product 1</Link>
            </div>
        </div>
    );
};

export default RouteTest;
